import React from 'react';

import {
    BrowserRouter as Router,
    Route, Switch, Link
  } from 'react-router-dom'
import Counter from './Counter';
  

function Navbar(){
    return(

    <div>
        
        

        <Route path="./About.js"></Route>
        <Route path="./Feedback.js"></Route>
        <Route path="/" exact></Route>
        
    </div>
    )
}
export default Navbar;
